import Pharmacie  from "../../assets/images/pa"

const Testimonials = () => {
    return (
    <Slider>
        <div className="testimonial py-4 px-3">
            <div className="d-flex align-items-center gap-4 mt-3">
                <img src={Restaurants} className="w-25 h-25 rounded-2" alt="" />
                <div>
                    <h6 className="mb-0 mt-3"> RESTAURANTS</h6>
                </div>
            </div>
        </div>

        <div className="testimonial py-4 px-3">
            <div className="d-flex align-items-center gap-4 mt-3">
                <img src={Restaurants} className="w-25 h-25 rounded-2" alt="" />
                <div>
                    <h6 className="mb-0 mt-3"> RESTAURANTS</h6>
                </div>
            </div>
        </div>

    </Slider>
    );

};
export default Testimonials;
